import React from 'react';
import Logo from './Logo';
import {Link} from 'react-router-dom';

const NavBar = () => {
    return(
        <nav className="nav-bar">
            <a href="/"><Logo /></a>
            <div className="">
                <a id="about-menu" href="/about">about
                    {/* <Link to="/about">about</Link> */}
                </a> 
                <a id="work-menu" href="/work">work</a> 
                <a id="play-menu" href="/play">play</a> 
            </div>
        </nav>
    )
}

export default NavBar;
